/**
 * Global Functions
 * getUsers() is designed to async pull from the indexDB that is built into the browser
 * It will save the Time/Volume collection protocol to users varible
 * It will save the BAER protocol to baerDB variable
 * A lot of these functions are originally designed for Time interval collection protocol
 * This is because Volume/BAER Protocol were a quick implementation of the overall project
 * But, other functions will either use or be duplicated/modified due to the implementation constraints of other protocols
 */
async function getUsers() {
  try {
    users = await db.collection('Database')
        .get()
//    console.log('users: ', users)
  }
  catch(error) {
//    console.log('error: ', error)
  }

  try {
    baerDB = await db.collection('DatabaseBAER')
        .get()
//    console.log('users: ', baerDB)
  }
  catch(error) {
//    console.log('error: ', baerDB)
  }
}

const readJsonFile = (file) => {
  return new Promise((resolve,reject) => {
    const reader = new FileReader();
    reader.onload = () => resolve(reader.result);
    reader.onerror = error => reject(error);
    reader.readAsDataURL(file);
  });
}

/**
 * Global Function
 * This function is used to store images into a base64 format
 * It will convert the following images passed through it and store them into the file state variable
 * Then will find its way into IndexDB When Stored
 * @param file
 */
const getBase64 = (file) => {
  return new Promise((resolve,reject) => {
    const reader = new FileReader();
    reader.onload = () => resolve(reader.result);
    reader.onerror = error => reject(error);
    reader.readAsDataURL(file);
  });
}

