  /**
   * This is for exporting Data for time and volume database
   */
  async exportDBTimeVolume() {
    const fileName = "TimeVolumeDatabase";
    const json = JSON.stringify(this.state.DatabaseData);
//    console.log(json);
    const blob = new Blob([json], {type: 'application/json'});
    const href = await URL.createObjectURL(blob);
    const link = document.createElement('a');
    link.href = href;
    link.download = fileName + ".json";
    document.body.appendChild(link);
    link.click();
    document.body.removeChild(link);
  }

  /**
   * This is for exporting Data for BAER database
   */
