  /**
   * This will calculate a polynomial regression and setup the CSV Array
   */
  SoilInfiltrometerCalculations() {
//    this.loadTable()
    //Calculating the constant "A"
    let eulersFormula = Math.E;
    let aCalculation = 0;
    aCalculation = (11.65*((Math.pow(this.state.NperH0,.1))-1) );

    if (this.state.NperH0 < 1.9) {
      aCalculation = aCalculation * Math.pow(eulersFormula, (7.5) * (this.state.NperH0 - 1.9) * (this.state.Alpha) * (this.state.Suction));
      aCalculation = aCalculation/(Math.pow(this.state.Alpha*this.state.Radius, .91));
    } else {
      aCalculation = aCalculation * Math.pow(eulersFormula, (2.92) * (this.state.NperH0 - 1.9) * (this.state.Alpha) * (this.state.Suction));
      aCalculation = aCalculation/(Math.pow(this.state.Alpha*this.state.Radius, .91));
    }

    //Calculating the constant "C1"
    let joined = [];
    for (let i = 0; i < this.state.Data.length; i++) {
      joined.push([
        this.state.Data[i].Sqrt,
        this.state.Data[i].Infilt
      ]);
    }

    let result = regression.polynomial(joined, { order: 2, precision: 15 });
    let C1Calcuation = result.equation[0];

    //Calculating the Constant "K"
    let KCalculation = C1Calcuation/aCalculation;


    this.setState({
      A: this.state.A = aCalculation,
      C1: this.state.C1 = C1Calcuation,
      K: this.state.K = KCalculation
    })

    //getting print out done for CSV File
    this.state.CSVArray.push({
      GPS: "",
      A: this.state.A,
      C1: this.state.C1,
      K: this.state.K,
      R2: result.r2,
      Equation: result.string,
    })
    for (let  i = 0; i < this.state.Data.length; i++) {
      this.state.CSVArray.push({
        X: result.points[i][0],
        Y: result.points[i][1],
        id: this.state.Data[i].id,
        "Time(sec)": this.state.Data[i].Time,
        "Sqrt(time)": this.state.Data[i].Sqrt,
        "Volume(mL)": this.state.Data[i].Volume,
        "Infilt(cm)": this.state.Data[i].Infilt,
      })
    }

    //Gets X,Y Coordinates for Graph
    let coordinates = [];
    for (let  i = 0; i < this.state.Data.length; i++) {
      coordinates.push({
        x: result.points[i][0],
        y: result.points[i][1],
      })
    }

//    console.log("Coordinates")
//    console.log(coordinates)

    //Saves to State
    this.setState({
      InfiltrometerCalculations: this.state.InfiltrometerCalculations = {
        A: this.state.A,
        C1: this.state.C1,
        K: this.state.K,
        Equation: result.string,
        EquationPoints: result.equation,
        GraphPoints: result.points,
        R2: result.r2,
        CSVArray: this.state.CSVArray,
        Coordinates: coordinates
      }
    })

//    console.log(result.string);
//    console.log(result.equation);
//    console.log(result.points);
//    console.log(result.r2);
//    console.log(this.state.InfiltrometerCalculations.Coordinates)
  }

