  /**
   * This for adding the specific volumetric data to the array
   */
  CalculatedAddToDataArrayBAER() {
    if (this.state.volume === "") {
      alert("Volumetric Data is Empty, Please Enter a number in the given text field.")
    } else {

      getUsers().then(r => "something")
      getUsers().then(r => "something")
      this.setState({
        DatabaseData: this.state.DatabaseData = users
      })

      this.state.calculatedTime = this.state.calculatedTime + parseInt(this.state.timeInterval);
      this.state.id++;
      this.state.previousVolume = this.state.volume;

      //If timerInterval is set to 60 seconds
      if (this.state.Data.length === 1) {
//        console.log(this.state.initialVolume + " - " + this.state.volume);

        //This is for the mLPerMinute
        if (this.state.timeInterval === 60) {
          this.setState({
            MLPerMin: this.state.MLPerMin = this.state.initialVolume - this.state.volume
          })
        } else {
          this.setState({
            MLPerMin: this.state.MLPerMin = ((this.state.initialVolume - this.state.volume) * 60)/this.state.timeInterval
          })
        }
      } else {
//        console.log(this.state.Data[this.state.Data.length - 1].Volume + " - " + this.state.volume)
        //This is for the mLPerMinute

        if (this.state.timeInterval === 60) {
          this.setState({
            MLPerMin: this.state.MLPerMin = this.state.Data[this.state.Data.length - 1].Volume - this.state.volume
          })
        } else {
          this.setState({
            MLPerMin: this.state.MLPerMin = ((this.state.Data[this.state.Data.length - 1].Volume - this.state.volume) * 60)/this.state.timeInterval
          })
        }
      }

      //This setting the infilt calculation
      this.setState({
        infilt: this.state.infilt = ((this.state.initialVolume - this.state.volume) / (Math.PI * Math.pow(this.state.Radius, 2)))
      })
      //

      let joined = this.state.Data.concat({
        id: this.state.id,
        Time: this.state.calculatedTime,
        Volume: this.state.volume,
        Infilt: this.state.infilt,
        MLPerMin: this.state.MLPerMin
      });
      this.setState({Data: joined})
//      console.log(this.state.Data)

      this.setState({
        volume: this.state.volume =  ""
      })

      this.state.volume = ""
    }
  }

  /**
   * This is when a person wants to switch to completed the BAER Protocol page
   */
  SwitchToDataCompletedBAER() {
    // getUsers().then(r => "something")
    // getUsers().then(r => "something")
    // this.setState({
    //   DatabaseData: this.state.DatabaseData = users
    // })

    this.setState({
      DatabaseData: this.state.DatabaseData = users,
      DatabaseDataBAER: this.state.DatabaseDataBAER = baerDB
    })

    let avg = 0;
    for (let  i = 0; i < this.state.Data.length; i++) {
      avg += this.state.Data[i].MLPerMin
    }
    avg = avg/(this.state.Data.length - 1);
//    console.log(avg)

    // if (this.state.timeInterval !== 60) {
    //   avg /= 60;
    // }

    this.state.CSVArray.push({
      GPS: ""
    })

    for (let  i = 1; i < this.state.Data.length; i++) {
      this.state.CSVArray.push({
        id: this.state.Data[i].id,
        "Time (s)": this.state.Data[i].Time,
        "Volume (mL)": this.state.Data[i].Volume,
        "Infilt (cm)": this.state.Data[i].Infilt,
        "mL/min": this.state.Data[i].MLPerMin,
      })
    }

    this.state.CSVArray.push({
      "AVG (mL/min)": avg,
      "Number of Replicates": this.state.NumberOfRuns,
    })

//    console.log("CSVARR")
//    console.log(this.state.CSVArray)

    this.setState({
      PageState: this.state.PageState = "DataCompleted",
      AverageMLPerMin: this.state.AverageMLPerMin = avg
    })
  }

