  //_______________________________________________________________________________
  //Experimental Protocol
  //Dr. Pastel Volume Protocol
  /**
   * This is for Volume Base Data Collection
   * It is very similar to Time based and uses most of the functions called execpt to which are modified below
   * All data will be stored in the Time base collection database
   */

  /**
   * This is a modified to follow the Volume Data Collection Protocol
   */
  AddToDataArrayExperimental() {
    // getUsers().then(r => "something")
    // getUsers().then(r => "something")
    // this.setState({
    //   DatabaseData: this.state.DatabaseData = users
    // })

    this.state.id++;

    //This is for the Volume Calculation:
    if (this.state.Data.length === 1) {
//        console.log(this.state.volume + " - " + this.state.VolumeInterval);

      this.setState({
        volume: this.state.volume =  this.state.initialVolume - this.state.VolumeInterval
      })
    } else {
//        console.log(this.state.Data[this.state.Data.length - 1].Volume + " - " + this.state.VolumeInterval)
      //This is for the mLPerMinute
      this.setState({
        volume: this.state.volume =  this.state.Data[this.state.Data.length - 1].Volume - this.state.VolumeInterval
      })
    }

    //This setting the square root of the time
    this.setState({
      sqrtTime: this.state.sqrtTime = Math.sqrt(this.state.TotalTime)
    })

    //This is for the infilt calculation
    this.setState({
      infilt: this.state.infilt = ((this.state.initialVolume - this.state.volume) / (Math.PI * Math.pow(this.state.Radius, 2)))
    })

    let joined = this.state.Data.concat({
      id: this.state.id,
      Time: this.state.TotalTime,
      Sqrt: this.state.sqrtTime,
      Volume: this.state.volume,
      Infilt: this.state.infilt
    });
    this.setState({Data: joined})
//      console.log(this.state.Data)


    // this.setState({
    //   volume: this.state.volume =  ""
    // })
    //
    // this.state.volume = ""
  }

